export function ClassNames(cls, mods, anotherClasses){


    console.log(Object.entries(mods)
    .filter((className, value) => Boolean(className))
    .map((className) => className))


    return [
        cls,
        ...anotherClasses,
        ...Object.entries(mods)
            .filter((className, value) => Boolean(className))
            .map((className) => className)


    ].join(' ')
}


